import React from 'react'
import styled from "@emotion/styled";

const Container = styled.div`
    display: flex;
    justify-content: center;
`

const Card = styled.div

const Result = ({ list }) => {
    const emojis = list && list.map( emoji => {
        if (emoji)
            return emoji.symbol;
        return null;
    });
    return (
        <Container>
            {emojis}
        </Container>
    );
}

export default Result;
